import React from 'react';
import './ProfilePage.css';

interface ProfileProps {
  email: string;
}

const ProfilePage: React.FC<ProfileProps> = ({ email }) => {
  return (
    <div className="profile-container">
      <div className="profile-circle">
        <p>{email}</p>
      </div>
    </div>
  );
};

export default ProfilePage;
